
<canvas
    id='cmvss'


    width="1400"
    height="275"
    style='padding:12px;
    /*height: 0.75in;*/
    height: 1.2in;
    /*width: 5in;*/
    border:  1px solid red;'>

</canvas>

    <script>

        let cmvss_back = new Image();

        cmvss_back.src = "data:image/png;base64,";


            let cmvss_canvas = document.getElementById('cmvss');


            let cmvss_ctx = cmvss_canvas.getContext('2d');

        cmvss_ctx.font = '30px sans-serif';
        cmvss_ctx.textAlign = 'bottom';

        cmvss_ctx.drawImage( cmvss_back, 0 , 0 , 1250, 258 );


        cmvss_ctx.fillText("{{ $vehicle->vin }}", 626, 142); // x: 626 y: 158
        cmvss_ctx.fillText("{{ $vehicle->manufacturer_code }}", 679, 220); //x: 595 y: 234
        cmvss_ctx.fillText("{{ date('Y-m') }}", 204, 142);//x: 206 y: 154
</script>
